function base64decode(b64) {
    const binString = atob(b64);
    const size = binString.length;
    const bytes = new Uint8Array(size);
    for (let i = 0; i < size; i++) {
      bytes[i] = binString.charCodeAt(i);
    }
    return bytes;
}

function decompressIntoResponse(input) {
    const gzipStream = new ReadableStream({
        start(controller) {
            controller.enqueue(input)
            controller.close()
        }
    })
    const wasmStream = gzipStream.pipeThrough(new DecompressionStream('gzip'))
    return new Response(wasmStream, {
        headers: {
          'Content-Type': 'application/wasm'
        }
    })
}
export default decompressIntoResponse(base64decode(""))